        self.label_6.setText(_translate("Dialog", "Optional Fields"))
        self.label_7.setText(_translate("Dialog", "    • Sequencing technology name: this will be included in the result file name"))
        self.label_21.setText(_translate("Dialog", "    • Synthesis technology name: this will be included in the result file name"))
